import React, { Component } from 'react';
import One from './one';

class Demo extends Component{
    render(){
        return(
            <div>
            <h1>Hi {this.props.name}</h1>
            <One />
            </div>
        );
    };
}
Demo.defaultprops = {
    name : 'Anonymous'
}
export default Demo;
